import React from 'react'
import Vote from './Vote'


const Pollsdetails = ({polls, setPolls, handleSelectPoll}) => {
  return (
    <div className='container pollsDetails'>
      <Vote 
        polls = {polls}
        setPolls = {setPolls}
      />
    </div>
  )
}

export default Pollsdetails
